import React from 'react'
import ListGroup from 'react-bootstrap/ListGroup';


export default function Pokemons({pokemon}) {
    return (        
        <ListGroup variant="flush" className="w-75 d-flex justify-content-center ">
            {pokemon.map(p=>(
                <ListGroup.Item action variant="success" >{p}</ListGroup.Item>
            ))}
        </ListGroup>
    )
}
